INSERT INTO `advertiser_info` VALUES (1, '电影《破局》上映了！！', '<p><strong>剧情介绍</strong></p><p><br></p><p>在不普通的一天里，高见翔警官先是历经了老母亲去世的打击，然后又被告知因疑似受贿而不得不接受配合，调查取证。在奔丧的路上，他又意外的撞到了行人，为了逃避责任，他只能手忙脚乱的毁尸灭迹。他以为生活可以回归到波澜不惊，却不料，他撞死的其实是一名通缉犯，而驾车逃逸的他也同样被警方盯上。与此同时，一个神秘电话打来，高警官惊觉，这一切竟然是个阴谋，而他已经深陷迷局。</p><p><br></p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p>', '2020-11-07 16:16:50');
